/* global fetch */

import React from "react";
import "./home.css";

class Home extends React.Component {
	constructor(props) {
		super(props);

		this.state = {
			workouts: [],
			user: props.user,
			isLoading: true
		};
	}

	componentDidMount() {
		fetch("http://workout.beynum.com/workout/api/homeload", { credentials: "include" })
			.then(response => response.json())
			.then(data => {

				this.setState({
					isLoading: false,
					workouts: data.workouts
				});

			});
	}

	render() {
		return (
			<div className="page">
				<h1>Welcome { user.firstName }</h1>
			</div>
		);
	}
}

export default Home;
